import React, { useEffect, useState } from 'react'
import { useAuth } from '../../hooks/UseAuth'
import { currentUser } from '../../Services/OrderService';

const OrdersPage = () => {
  const { email } = useAuth();
  const [ cart, setCart ] = useState({});
  const emailId = email;

  useEffect(() => {
    const getNewOrder = async () => {
      try {
        const data = await currentUser(emailId);
        setCart(data);
      } catch (error) {
        console.error('Error fetching order:', error);
      }
    };

    getNewOrder();
  }, [emailId]);
  return (
    <div>
      {}
    </div>
  )
}

export default OrdersPage
